CREATE procedure [dbo].[stat_change_instruct] @t_testing_id uniqueidentifier
as declare @status varchar(10) declare @t_test_id uniqueidentifier declare @step_order int declare @current_step_id uniqueidentifier
SET XACT_ABORT ON;

begin
select @t_test_id=t_test_id
from t_test where order_num = ( select min(order_num) from t_testing_test tt inner join t_test te on tt.t_test_id= te.t_test_id where tt.t_testing_test_status_id = 4 and tt.t_testing_id = @t_testing_id )
